import './Footer.css';
import {FOOTER_account} from '../../const.js';
import {FOOTER_socials} from '../../const.js';

function Footer() {
    return (
        <div className="Footer">









        <div className="section3">
            <h4>My Account</h4>
        {FOOTER_account.map((account) => {
            return (
                <div>
                    <a href={account.link}>
                    {account.name}
                    </a>
                </div>
            );
        })}
        </div>



        <div className='section4'>
            <h4>Subscribe to our newsletter</h4>
		    <input type="text" name="" value="Email address" />
            <button type="button" name="button">SUBSCRIBE</button>
            <div className='social_icon'>
            {FOOTER_socials.map((socials) => {
            return (
                <div>
                    <a href={socials.link}>
                    {socials.src}
                    </a>
                </div>

            );
            })}
        </div>



        </div>


        </div>
    );
}

export default Footer
